import React, { useState } from 'react';
//import data from './data/products.json';
import './App.css';
import './ProductMenu.css';
import data from './data/products.json';
import ProductCard from './ProductCard';

const ProductMenu = ({ match }) => {

    const [catPris, setCatPris] = useState(true);

    function setCategoryVisibility(category) {
        if(category === "catPris"){
            setCatPris(!catPris);
        }
    }

    return(
        <div className="container main-con">
            <div className="product-categories">
                <p>Eindom</p>
                <div class="input-group mb-3">
                    <input type="text" className="form-control" placeholder="Søk i eindom..."></input>
                    <button class="btn btn-outline-secondary" type="button"><i class="fas fa-search"></i></button>
                </div>
                
                <div className="category border rounded">
                    <div id="category-header" onClick={() => setCategoryVisibility("catPris")}>
                            <span>Pris</span>
                            <i class="fas fa-chevron-down"></i>
                    </div>
                    <div className="category-content">
                        {catPris &&
                            <div class="pricecontainer" style={{marginTop: "25px",marginBottom: "15px"}}>
                                <div className="price-slider w-100">
                                    <div id="priceOverSlider">
                                        <label className="text-muted"><small>300kr</small></label>
                                        <label className="text-muted"><small>30000 kr</small></label>
                                    </div>
                                    <input type="range" min="1" max="100" value="50" className="slider w-100" id="myRange"/>
                                </div>
                                <div className="price-inputs form-group">
                                    <input type="text" className="form-control" id="min-price-input" placeholder="min. pris"></input>
                                    <input type="week" className="form-control" id="max-price-input" placeholder="max. pris"></input>
                                </div>
                            </div>
                        }
                    </div>
                </div>
                <div className="category border rounded">
                    <div id="category-header">
                            <span>Pris</span>
                            <i class="fas fa-chevron-down"></i>
                    </div>
                    <div className="category-content">
                        
                    </div>
                </div>
                
            </div>
            <div className="products-div border border-rounded">
                <div className="sort-dropdown-menu">
                    <span>34 Treff</span>
                    <div class="dropdown">
                        <button class="btn btn-outline-primary dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                            Sorter Etter
                        </button>
                        <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                            <li><a class="dropdown-item" href="#">Action</a></li>
                            <li><a class="dropdown-item" href="#">Another action</a></li>
                            <li><a class="dropdown-item" href="#">Something else here</a></li>
                        </ul>
                        </div>           
                </div>
                <div className="tags">
                    <span className="border rounded-pill">Mazda</span>
                    <span className="border rounded-pill">Til Salgs</span>
                </div>
                <div className="products">
                    <div class="row">  
                        {data.map(data => {
                            return(
                                <div class="col-md-4 mb-4" key={data.name}>
                                    <ProductCard 
                                        img={data.images} 
                                        price={data.price} 
                                        name={data.name} 
                                        location={data.location} 
                                        id={data.id}
                                        data={data}/>
                                </div>
                            ) 
                        })}                                                      
                    </div>
                </div>  
            </div>
        </div>
    )
}

export default ProductMenu;
